import React from "react";

class WeeklyMatchesForm extends React.Component {
    render() {
        return (
            <div>
                
                <button onClick={this.props.handleAddMatchesClick}>Submit match information</button>
            </div>
        );
    }
}

export default WeeklyMatchesForm;
